import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>Sports Connect</h1>
      <div className="navbar-buttons">
        <Link to="/cricket"><button className="sport-button">Cricket</button></Link>
        <Link to="/basketball"><button className="sport-button">Basketball</button></Link>
        <Link to="/football"><button className="sport-button">Football</button></Link>
        <Link to="/volleyball"><button className="sport-button">Volleyball</button></Link>
      </div>
      <div className="admin-button-container">
        <Link to="/admin-login"><button className="admin-button">Admin</button></Link>
      </div>
    </nav>
  );
};

export default Navbar;
